script: |
  super -f text -I q685.spq | sort > q685.out

inputs:
  - name: q685.spq
    data: |
      SELECT ALL + + ( + - col2 ) AS col1, col2 FROM tab2 (FORMAT parquet) WHERE NOT NULL NOT BETWEEN - - col1 / col0 + + 19 + - + col0 AND + col2 + + col0;
  - name: tab2

outputs:
  - name: q685.out
    data: |
